function CommonParseCSV(str) {
    let arr = [];
    let quote = false;
    let c;
    let col;
    str = str.replace(/\r\n/g, '\n').trim();
    for (let row = col = c = 0; c < str.length; c++) {
        let cc = str[c], nc = str[c + 1];
        arr[row] = arr[row] || [];
        arr[row][col] = arr[row][col] || '';
        if (cc == '"' && quote && nc == '"') {
            arr[row][col] += cc;
            ++c;
            continue;
        }
        if (cc == '"') {
            quote = !quote;
            continue;
        }
        if (cc == ',' && !quote) {
            ++col;
            continue;
        }
        if (cc == '\n' && !quote) {
            ++row;
            col = 0;
            continue;
        }
        arr[row][col] += cc;
    }
    return arr;
}
