function KDGetByWeight(list) {
    let WeightTotal = 0;
    let Weights = [];
    let type = "";
    for (let obj of Object.entries(list)) {
        Weights.push({ obj: obj[0], weight: WeightTotal });
        WeightTotal += obj[1];
    }
    let selection = KDRandom() * WeightTotal;
    for (let L = Weights.length - 1; L >= 0; L--) {
        if (selection > Weights[L].weight) {
            type = Weights[L].obj;
            break;
        }
    }
    return type;
}
